import React from "react";

import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <nav>
        <NavLink
          to="/"
          style={({ isActive }) => {
            return { backgroundColor: isActive == true ? "red" : "white" };
          }}
          className="nav-bar-link"
        >
          About
        </NavLink>
        <NavLink to="/contact" className="nav-bar-link">
          Contact
        </NavLink>
      </nav>
    </>
  );
};

export default Navbar;

